import React from 'react';

const ClientList = ({ clients }) => {
  return (
    <ul>
      {clients.map((client) => (
        <li key={client.customers_id}>
          {client.last_name}, {client.first_name} - {client.email}
        </li>
      ))}
    </ul>
  );
};

export default ClientList;
